import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import banner_img from "./Images/Banner1.jpeg";
import header_img from "./Images/header.jpg";

const SurveyPage = () => {
  return (
    <>
      <div className="header">
        <img src={header_img} alt="header" style={{
          width: "100%",
          objectFit: "cover | fill",
          position: "top",
          top: "0",
          left: "0",
          zIndex: "-2"
        }}/>
        </div>
      <div className="banner">
        <img src={banner_img} alt="banner" style={{
          width: "100%",
          objectFit: "cover | fill",
          position: "top",
          top: "0",
          left: "0",
          zIndex: "-2",
        }} />
        <div className="banner-overlay" style={{
          position: "absolute",
          top: "0",
          left: "0",
          width: "100%",
          height: "100%",
          backgroundColor: "rgba(0, 0, 0, 0.5)",
          zIndex: "-1",
        }} />
        <div className="banner-content" style={{
          position: "absolute",
          top: "50%",
          left: "50%",
          transform: "translate(-50%, -50%)",
          textAlign: "center",
          color: "white",
          zIndex: "0",
        }}>
          <h4>VIETNAM</h4>
          <h2>Hanoi</h2>
        </div>
      </div>
      <div className="container">
        <div className="card" style={{
          //reduce corner rounding
          borderRadius: "0.3rem",
          //reduce shadow
          boxShadow: "none",
          //reduce padding
          padding: "1rem",
          //reduce margin
          margin: "1rem",
          //reduce border
          border: "none",
          //reduce hover effect
          transition: "none"
        }}>
          <div className="card-body">
            <h5 className="card-title" style={{
              textAlign: "center"
            }}>Trip Planner</h5>
            <div className="card-text">
              <p>Insert the rest of the content here</p>
            </div>
          </div>
        </div>
        <br />
      </div>
      <div className="container">
        // adding cards here for the survey results
      </div>

    </>
  );
};

export default SurveyPage;
